// import '../custom.js';
// import '../owl.carousel.min.js';
// import '../jquery.backstretch.min.js';
// import '../jquery.min.js';
// import './Home.css'; // Assuming you have a Home.css file for styles

const Home =() =>{
    return(
        <>
            <Header />
            <Body />
            <Footer />
        </>
    )
}

export default Home;
